var longestCommonSubsequence = function (text1, text2) {
  const n = text1.length;
  const m = text2.length;

  const obj = {};
  for (let j = 0; j <= m; j++) {
    obj[0 + "-" + j] = 0;
  }

  for (let i = 0; i <= n; i++) {
    obj[i + "-" + 0] = 0;
  }

  for (let i = 1; i <= n; i++) {
    for (let j = 1; j <= m; j++) {
      if (text1[i - 1] === text2[j - 1]) {
        obj[i + "-" + j] = 1 + obj[(i - 1) + "-" + (j - 1)];
      } else {
        obj[i + "-" + j] = Math.max(obj[(i - 1) + "-" + j], obj[i + "-" + (j - 1)]);
      }
    }
  }

  return obj[n + "-" + m];
};

const result = longestCommonSubsequence(
  "",
  ""
);

